import React from 'react';
import MovieThumb from './MovieThumb.js';

class MovieList extends React.Component {
    render(){
        return(
            <article>
                { this.props.movies.map( (m) =>
                        <MovieThumb movie={m} movie={m.id} /> )}
            </article>
        );
    }
}

export default MovieList;
